  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Huron Wetland Management District, Madison Wetland
  Management District, and Sand Lake Wetland Management District for the next 15 years.
  This plan outlines the districts' vision and purpose and describes how Huron Wetland
  Management District, Madison Wetland Management District, and Sand Lake Wetland
  Management District will contribute to the overall mission of the Refuge System.
  The plan provides an introduction to the WMDs, an overview of the CCP process, alternatives,
  a description of the affected environment, environmental consequences, and strategies
  for implementation. Key planning issues include: wetland management, upland management,
  invasive plant control, energy development, prairie conservation, predator management,
  visitor services, partnerships, operations, and monitoring.\",\n\t\"license_title\":
